(872, 17, 235, 34, 'Left eye injury occurred when the daughter poked her in the eye with finger about 2 weeks ago and caused her eye to be red. She now has double vision the the left eye when she reads due to the injury with both eyes itchy and watery. She feels like both eyes are pulsing, and feels like there are dirt and rocks in her eyes. The pain is worse when she is reading. She states that the last medical team here gave her eye drops for dry eyes back in June but the eye injury is new. ', '2014-12-29 12:06:25', 306),
(873, 17, 235, 34, 'Patient presents with yellow vaginal discharge that she states she has had since she gave birth 8 months ago. She states that she has had pink urine for 5 months now and the last time she peed it was the same color. She states in June hey gave her amoxicillin and doxycycline for it and it didn''t help but she took all of the pills. She has some lower abdominal pain and back pain. She was not able to describe a smell of the discharge but notes that iit is itchy. She notes a burning sensation when she pees. She pees very often without urgency. She states she wakes up to pee throughout the night. \n\nHer last period was this December and has been sexually active this month. ', '2014-12-29 12:06:25', 307),
