(885, 8, 231, 34, 'One year ago patient states she was washing clothes when she became weak and numb in her left leg and fell down, but now denies any current numbness/weakness in her left leg. She came to a clinic 6 months ago where they gave her lisinopril for her HTN, but she has not been taking it. She denies any CP, SOB, dizzniness, or headache. ', '2014-12-29 12:09:58', 299),
