(908, 11, 225, 34, 'Headache started years ago. Sudden onset, with a 2hr duration. Occurs approximately once per week. Headaches are unilateral. Describes pain as sharp and pulsating. Patient denies any vision problems. Headache does not wake the patient up at night and is not temporal. \n\nSamantha Terranella M2 ', '2014-12-29 12:29:16', 292),
