(921, 13, 248, 34, '40 year old woman presents to clinic for several complaints. She appears thin, gaunt, and malnourished. Face is thin and prominent rib age.\r\n\r\n1. Tooth pain: Pain began in November of 2014. Left molars in lower jaw appear dark colored with irregular shape and texture. Patient reports a foul smell. Denies shortness of breath or dyspnea. Lung sounds present and equal bilaterally\r\n\r\n2. Scalp pain: pain began June 2014. Feels painful in skin of scalp, not a headache. Loud sounds and ruminating about her life makes it worse and talking to her mother makes it better. Pain has gotten worse since the death of her mother in June 2014.', '2014-12-29 12:57:27', 326),
