(943, 7, 244, 35, 'We had the pleasure of seeing Carls in clinic this afternoon.  He is a pleasant 6yo Haitian who presented today with dry eyes.  His wells exam was normal and so we prescribed refresh eye drops.  Of other note is that Carls has a small umbilical hernia which we encouraged his mother to seek a surgical correction at some time in the future.  We counseled that the surgery is small and that it would likely become increasingly aggravated as Carls ages.', '2014-12-29 13:19:01', NULL),
