(958, 7, 241, 35, 'We had the pleasure of seeing Ruthe in clinic this afternoon.  She is a pleasant 32yo Haitian woman who presented with 4 chief complaints--dry eyes, headaches, toothaches, and abd pain during urination. \r\n\r\n- Urine test was negative for infection, but demonstrated high SG, KET, and slight presence of blood.\r\n- Pelvic exam was unremarkable; cervix demonstrated presence of blood suggesting onset of period (which correlates with her noted last period). Patient was counseled about her dehydration (high SG) which could lead to burning during urination and/or abd pain. \r\n- Dental exam was notable for potential chipped tooth (probably earlier), but 3 cavities were filled and so we counseled patient to return for HART dentists in June and provided symptomatic relief with Ibuprofen.\r\n- HEENT exam was unremarkable \r\n- Patient was counseled on need for increased water intake.', '2014-12-29 13:29:37', NULL),
(959, 7, 241, 36, 'Normal menstrual cycle--onset of period', '2014-12-29 13:29:37', NULL),
