(979, 17, 255, 34, 'Patient presents with shortness of breath and has recurrent bronchitis with a bothersome cough that she states has always been there. Negative for blood in cough but coughs up white phlegm. She states she does have chest pain from her lungs that radiates to her back. She also states she is asthmatic. All of these symptoms have started when she was 8. Negative for weight loss.  She states that she oxygen and her albuterol inhaler make it better. She has her albuterol inhaler with her today. She uses her albuterol about three times a day. She was hospitalized last Tuesday 12/16/14 and given prescriptions for prednisone, albuterol inhaler, and albuterol neb. She states they put her on oxygen in the hospital and it made her feel better. She states that her breathing is worse when she lays down and it is hard for her to fall asleep especially when it is hot out. She states that she has to take her inhaler before she goes to bed. ', '2014-12-29 13:48:37', 343),
