(4510, 76, 1516, 34, 'Patient is a 67 yo female presenting with abdominal pain and eye pain.\r\n\r\nThe abdominal pain started yesterday. She does not think it is a parasite. It hurts all the time and it does not get better when she eats. No diarrhea. Most of the buring is in her upper abdomen. She does not know if she has gastritis. \r\n\r\nShe also mentioned that her legs hurt. There is swelling in her L ankle. She fractured her left foot 7 months ago and had surgery. Since the surgery it has been swollen. She had a follow up and was told to put a "natural medicine" on it. \r\n\r\nHer knees also hurt but says that they hurt before the surgery. She describes the pain as strong and sometimes she is unable to walk. \r\n\r\nShe also has had trouble seeing and her eyes are watery. It started almost 10 years ago when she fell and hit her head. She has seen a doctor and was prescribed eye drops. She says she needs new glasses because she can no longer see well with her old ones. Her glasses helped with vision when they worked but she still had pain. She gets dizzy because of her eye pain. She also mentioned she has numbness on the L face and has trouble tasting food.', '2015-05-15 13:34:14', 2037),
(4511, 86, 1514, 34, 'Patient is 22 kg. Headache and stomach pain since she was born. Hearing pain for the past four years. Presents with left middle ear pain since yesterday and difficulty hearing. Reports having a fever for the past for days and a cough all night with yellow sputum. Mouth and tongue burning pain for the past three days, associated wit h the onset of the fever. She states it hurts when she eats. Trouble eating for the past two weeks. Only is able to eat a little bit and only drinks water in the morning. She is hungry, but it hurts when she eats. Upon auscultation, crackling heard in the center of her abdomen.', '2015-05-15 13:36:30', 2031),
