(4699, 76, 1559, 34, 'Last week it started and it is also itchy when it is secreting. It does not hurt. It is liquid and yellow. No smell to the secretion. This is the first time that she has had anything like this. She has been sexually active with one partner and does not use protection. She has no problems urinating. She wipes back to front with toilet paper. She went to the pharmacia and asked for help ,they gave her two capsules and it did help. it was a sepository. She had that last week. They did not give her any tests or info that could help her know what it is. She had a fever at the beginning of all of this. \n\nHer back started hurting about 2 days ago it was really painful and she couldnt move. It does not hurt to the touch. She deescribes that pain as tension. The pain stays in one spot on the spine. When she woke up she just had this pain. She put warm water on it and it helped a little bit. She has had the same pain in the passed. \n\n5 years ago she had paralysis in her face and she had head aches since. \nShe also has dandruff.', '2015-05-16 11:35:56', 2104),
