(4728, 79, 1570, 34, 'Patient presents with burning pain, weakness, and numbness in her hands that has been worsening over the past thirty years. Pain in the joints in her fingers. She works all day on the farm and she notices the pain at the end of the day when she is done working. She has used a couple of natural remedies to treat the pain.\r\n\r\nShe has had frontal headaches for the past couple of years. Constant presume pain, no pulsing. No nausea, vomiting, neck pain, or blurry vision. She reports having had itching and burning eyes in the past, and she also  has had runny noses associated with the headaches.\r\n\r\nShe has had right shoulder pain since she was a child. She had an injection for what she says is measles when she was 7. She has had pain and itching in her shoulder for 22 years.\r\n\r\nShe has had vision problems seeing long distances for theist four years.', '2015-05-16 12:31:36', 2117),
