(4756, 76, 1574, 34, 'pain starts at about the height of her ears down to the bottom of her neck. It started 15 days ago. The pain persists while she is laying. Sometimes the pain moves to her eyes and forehead. She is a a cook at a restaraunt and works from 7 in the morning to 9 at night every day besides sunday. Her pain is constant starting this week. She cannot move her neck very well. Rubbing it does not make it feel better. Menthol helps a little bit. She has symptoms of mmigraines. She eats enough. It is only radiating up to her head. She has a good amount of stress from work and at home with her husband starts the pain. When she cracks her neck it helps a little bit. Tingling present in the hands, bilaterally when exeriencing pain. No focal weakness in the extremities. \r\n\r\nPt also reports of intermittent lower back and abdominal pain. These synptoms began about one week ago, and she has experienced only two isolated episodes, most recently yesterday. No back or abdominal pain today.', '2015-05-16 13:35:18', 2121),
(4757, 76, 1574, 36, 'Neck pain', '2015-05-16 13:35:18', NULL),
(4758, 76, 1574, 36, 'Arthritis, Osteo', '2015-05-16 13:35:18', NULL),
(4759, 76, 1574, 37, 'This condition would respond well to muscle relaxants, needs to see local pharmacy. (Tensiflex)\r\nNaproxen and Bengay for pain. \r\nif weakness or tingling worsen, need further imaging/work-up at clinic.', '2015-05-16 13:35:18', NULL);
