INSERT INTO `play_evolutions` (`id`, `hash`, `applied_at`, `apply_script`, `revert_script`, `state`, `last_problem`) VALUES
(1, '9075fbf3ed7865119345001c3c3fb99f26f12ca9', '2014-12-14 00:56:34', 'CREATE  TABLE `users` (\n`id` INT NOT NULL AUTO_INCREMENT ,\n`first_name` VARCHAR(255) NOT NULL ,\n`last_name` VARCHAR(255) NULL ,\n`email` VARCHAR(255) NOT NULL ,\n`password` VARCHAR(255) NOT NULL ,\nPRIMARY KEY (`id`) ,\nUNIQUE INDEX `id_UNIQUE` (`id` ASC) ,\nUNIQUE INDEX `email_UNIQUE` (`email` ASC) );', 'DROP TABLE IF EXISTS users;', 'applied', ''),
(2, '01e9f90df1df02ded0e38976449c49e379321e83', '2014-12-14 00:56:35', 'CREATE  TABLE `roles` (\n`id` INT NOT NULL AUTO_INCREMENT ,\n`name` VARCHAR(255) NOT NULL ,\nPRIMARY KEY (`id`) ,\nUNIQUE INDEX `id_UNIQUE` (`id` ASC) ,\nUNIQUE INDEX `name_UNIQUE` (`name` ASC) )\nDEFAULT CHARACTER SET = utf8;\n\nINSERT INTO `roles` (`name`) VALUES (''Administrator'');\nINSERT INTO `roles` (`name`) VALUES (''Physician'');\nINSERT INTO `roles` (`name`) VALUES (''Pharmacist'');\nINSERT INTO `roles` (`name`) VALUES (''Researcher'');', 'DROP TABLE IF EXISTS roles;', 'applied', ''),
(3, 'd3e299658e6ea58835080855516dbeb648c04411', '2014-12-14 00:56:35', 'CREATE  TABLE `user_roles` (\n`id` INT NOT NULL AUTO_INCREMENT ,\n`user_id` INT NOT NULL ,\n`role_id` INT NOT NULL ,\nPRIMARY KEY (`id`) ,\nUNIQUE INDEX `id_UNIQUE` (`id` ASC) ,\nINDEX `fk_user_roles_user_id_users_id` (`user_id` ASC) ,\nINDEX `fk_user_roles_role_id_roles_id` (`role_id` ASC) ,\nCONSTRAINT `fk_user_roles_user_id_users_id`\nFOREIGN KEY (`user_id` )\nREFERENCES `users` (`id` ),\nCONSTRAINT `fk_user_roles_role_id_roles_id`\nFOREIGN KEY (`role_id` )\nREFERENCES `roles` (`id` ))\nDEFAULT CHARACTER SET = utf8;', 'DROP TABLE IF EXISTS `user_roles`;', 'applied', ''),
(4, 'ed498f25dbfdcc5ccce25a1ba21ab9d3249ef369', '2014-12-14 00:56:35', 'CREATE TABLE `patients` (\n`id` INT NOT NULL AUTO_INCREMENT ,\n`first_name` VARCHAR(255) NOT NULL ,\n`last_name` VARCHAR(255) NOT NULL ,\n`age` INT NOT NULL ,\n`sex` VARCHAR(10) NOT NULL ,\n`address` VARCHAR(255) NOT NULL ,\n`city` VARCHAR(255) NOT NULL ,\nPRIMARY KEY  (`id`) ,\nUNIQUE INDEX `id_UNIQUE` (`id` ASC))\nDEFAULT CHARACTER SET = utf8;', 'DROP TABLE IF EXISTS `patients`;', 'applied', ''),
(5, '1188cdcaa1f811571689e5e11de3bc5eb21a5f3b', '2014-12-14 00:56:35', 'ALTER TABLE `patients`\nADD COLUMN `user_id` INT NOT NULL AFTER `id` ,\nADD CONSTRAINT `fk_patients_user_id_users_id`\nFOREIGN KEY (`user_id` )\nREFERENCES `users` (`id` )\n, ADD INDEX `user_id_idx` (`user_id` ASC);', 'ALTER TABLE `patients` DROP FOREIGN KEY `fk_patients_user_id_users_id` ;\nALTER TABLE `patients` DROP COLUMN `user_id`\n, DROP INDEX `user_id_idx` ;', 'applied', ''),
(6, 'e7d90427fee3b02e251f6ffb66b5192873b53356', '2014-12-14 00:56:36', 'CREATE  TABLE `patient_encounters` (\n`id` INT NOT NULL AUTO_INCREMENT ,\n`patient_id` INT NOT NULL ,\n`user_id` INT NOT NULL ,\n`date_of_visit` DATETIME NOT NULL ,\n`chief_complaint` VARCHAR(255) NULL ,\nPRIMARY KEY (`id`) ,\nUNIQUE INDEX `ID_UNIQUE` (`id` ASC) ,\nINDEX `patient_id_idx` (`patient_id` ASC) ,\nINDEX `user_id_idx` (`user_id` ASC) ,\nCONSTRAINT `fk_patient_encounter_patient_id_patients_id`\nFOREIGN KEY (`patient_id` )\nREFERENCES `patients` (`id` ),\nCONSTRAINT `fk_patient_encounter_user_id_users_id`\nFOREIGN KEY (`user_id` )\nREFERENCES `users` (`id` ));', 'DROP TABLE IF EXISTS `patient_encounters`;', 'applied', ''),
(7, 'c4efe3becf7f859503200dd8c3bc271838379a2f', '2014-12-14 00:56:36', 'CREATE  TABLE `vitals` (\n`id` INT NOT NULL AUTO_INCREMENT ,\n`name` VARCHAR(255) NOT NULL ,\n`data_type` VARCHAR(255) NULL ,\n`unit_of_measurement` VARCHAR(255) NULL ,\nPRIMARY KEY (`id`));\n\nINSERT INTO `vitals` (`name`,`data_type`,`unit_of_measurement`)\nVALUES (''Respiratory Rate'',''int'',''breaths/minute'');\n\nINSERT INTO `vitals` (`name`,`data_type`,`unit_of_measurement`)\nVALUES (''Heart Rate'',''int'',''beats/minute'');\n\nINSERT INTO `vitals` (`name`,`data_type`,`unit_of_measurement`)\nVALUES (''Temperature'',''float'',''Fahrenheit'');\n\nINSERT INTO `vitals` (`name`,`data_type`,`unit_of_measurement`)\nVALUES (''Oxygen Saturation'',''float'',''percent'');\n\nINSERT INTO `vitals` (`name`,`data_type`,`unit_of_measurement`)\nVALUES (''Height'',''int'',''feet'');\n\nINSERT INTO `vitals` (`name`,`data_type`,`unit_of_measurement`)\nVALUES (''Height'',''int'',''inches'');\n\nINSERT INTO `vitals` (`name`,`data_type`,`unit_of_measurement`)\nVALUES (''Weight'',''float'',''pounds'');\n\nINSERT INTO `vitals` (`name`,`data_type`,`unit_of_measurement`)\nVALUES (''Blood Pressure'',''int'',''systolic'');\n\nINSERT INTO `vitals` (`name`,`data_type`,`unit_of_measurement`)\nVALUES (''Blood Pressure'',''int'',''diastolic'');', 'DROP TABLE IF EXISTS `vitals`', 'applied', ''),
