(36, '694867b590d56e00fe08392c3d90e3045c716127', '2014-12-14 00:56:48', 'CREATE  TABLE `patient_encounter_pmh_fields` (\n`id` INT NOT NULL AUTO_INCREMENT ,\n`user_id` INT NULL ,\n`patient_encounter_id` INT NULL ,\n`pmh_field_id` INT NULL ,\n`pmh_field_value` VARCHAR(255) NULL ,\n`date_taken` DATETIME NULL ,\nPRIMARY KEY (`id`) ,\nUNIQUE INDEX `id_UNIQUE` (`id` ASC) ,\nINDEX `fk_patient_encounter_pmh_fields_user_id_users_id_idx` (`user_id` ASC) ,\nINDEX `fk_patient_encounter_pmh_field_id_pmh_fields_id_idx` (`pmh_field_id` ASC) ,\nINDEX `fk_patient_encounter_pmh_fields_patient_encounter_id_idx` (`patient_encounter_id` ASC) ,\nCONSTRAINT `fk_patient_encounter_pmh_fields_user_id_users_id`\nFOREIGN KEY (`user_id` )\nREFERENCES `users` (`id` )\nON DELETE NO ACTION\nON UPDATE NO ACTION,\nCONSTRAINT `fk_patient_encounter_pmh_fields_pmh_field_id_pmh_fields_id`\nFOREIGN KEY (`pmh_field_id` )\nREFERENCES `pmh_fields` (`id` )\nON DELETE NO ACTION\nON UPDATE NO ACTION,\nCONSTRAINT `fk_patient_encounter_pmh_fields_patient_encounter_id`\nFOREIGN KEY (`patient_encounter_id` )\nREFERENCES `patient_encounters` (`id` )\nON DELETE NO ACTION\nON UPDATE NO ACTION);', 'DROP TABLE IF EXISTS `patient_encounter_pmh_fields`;', 'applied', ''),
(37, '250388aba2193d8be976261601f40df0b6b2b911', '2014-12-14 00:56:49', 'ALTER TABLE `patient_encounter_pmh_fields`\nDROP FOREIGN KEY `fk_patient_encounter_pmh_fields_pmh_field_id_pmh_fields_id` ,\nDROP FOREIGN KEY `fk_patient_encounter_pmh_fields_patient_encounter_id` ,\nDROP FOREIGN KEY `fk_patient_encounter_pmh_fields_user_id_users_id` ;\nALTER TABLE `patient_encounter_pmh_fields`\nCHANGE COLUMN `user_id` `user_id` INT(11) NOT NULL  ,\nCHANGE COLUMN `patient_encounter_id` `patient_encounter_id` INT(11) NOT NULL  ,\nCHANGE COLUMN `pmh_field_id` `pmh_field_id` INT(11) NOT NULL  ,\nCHANGE COLUMN `pmh_field_value` `pmh_field_value` VARCHAR(255) NOT NULL  ,\nCHANGE COLUMN `date_taken` `date_taken` DATETIME NOT NULL  ,\nADD CONSTRAINT `fk_patient_encounter_pmh_fields_pmh_field_id_pmh_fields_id`\nFOREIGN KEY (`pmh_field_id` )\nREFERENCES `pmh_fields` (`id` )\nON DELETE NO ACTION\nON UPDATE NO ACTION,\nADD CONSTRAINT `fk_patient_encounter_pmh_fields_patient_encounter_id`\nFOREIGN KEY (`patient_encounter_id` )\nREFERENCES `patient_encounters` (`id` )\nON DELETE NO ACTION\nON UPDATE NO ACTION,\nADD CONSTRAINT `fk_patient_encounter_pmh_fields_user_id_users_id`\nFOREIGN KEY (`user_id` )\nREFERENCES `users` (`id` )\nON DELETE NO ACTION\nON UPDATE NO ACTION;', 'ALTER TABLE `patient_encounter_pmh_fields`\nDROP FOREIGN KEY `fk_patient_encounter_pmh_fields_pmh_field_id_pmh_fields_id` ,\nDROP FOREIGN KEY `fk_patient_encounter_pmh_fields_patient_encounter_id` ,\nDROP FOREIGN KEY `fk_patient_encounter_pmh_fields_user_id_users_id` ;\nALTER TABLE `patient_encounter_pmh_fields`\nCHANGE COLUMN `user_id` `user_id` INT(11) NULL  ,\nCHANGE COLUMN `patient_encounter_id` `patient_encounter_id` INT(11) NULL  ,\nCHANGE COLUMN `pmh_field_id` `pmh_field_id` INT(11) NULL  ,\nCHANGE COLUMN `pmh_field_value` `pmh_field_value` VARCHAR(255) NULL  ,\nCHANGE COLUMN `date_taken` `date_taken` DATETIME NULL  ,\nADD CONSTRAINT `fk_patient_encounter_pmh_fields_pmh_field_id_pmh_fields_id`\nFOREIGN KEY (`pmh_